description:
From Babel to Babylon, humanity fails to make their own way. REVELATION 18 explains the destruction of sinful Babylon and how it will be found no more. Study through Biblical prophecy and learn the authority and power of the True and Living God.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
